def _get_time_bins(self, ax):
    if not isinstance(ax, DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got "
            f"an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    first = ax[0].replace(hour=0, minute=0, second=0, microsecond=0, nanosecond=0)
    last = ax[-1] + self.freq
    bins = []

    current_bin_start = first
    for i in range(len(ax)):
        if ax[i] < current_bin_start:
            continue
        if ax[i] < current_bin_start + self.freq:
            bins.append(i)
        else:
            current_bin_start += self.freq
            bins.append(i)

    binner = ax[bins]
    labels = binner.copy()
    labels = labels.shift(-1)

    if self.closed == "left":
        labels = labels[:-1]
    elif self.closed == "right":
        labels = binner.copy()
    if ax.hasnans:
        binner = binner.insert(0, NaT)
        labels = labels.insert(0, NaT)

    return binner, bins, labels
